import React, { useState } from 'react'
import Cardturn from './Cardturn'

function Maingame() {
  const [mainGame, setMainGame] = useState(["X","O"]);

  return (
    <div className='mainGame'>
      <Cardturn val={mainGame[0]}/>
      <Cardturn val={mainGame[1]}/>
      <Cardturn/>
    </div>
  )
}

export default Maingame
